import React from 'react';
import DataAndExtractLink from './DataAndExtractLink';

const OffersAndLink = () => {
  return (
    <DataAndExtractLink
      render={({ link, loading, error }) => {
        if (loading) {
          return <div>Loading...</div>;
        }

        if (error) {
          return <div>Error: {error}</div>;
        }

        if (!link) {
          return <div>No link available</div>;
        }

        return (
          <div>
            <h2>Link:</h2>
            <p>{link}</p>
            <h2>Offers:</h2>
            <ul>
              {link &&
                link.offers.map((offer, index) => (
                  <li key={index}>
                    <h3>{offer.name}</h3>
                    <p>Rate: {offer.bonuses.rate}</p>
                    <p>Amount: {offer.bonuses.amount}</p>
                    <p>Free Spins: {offer.bonuses.free_spins}</p>
                    <p>Welcome Bonus: {offer.bonuses.welcome_bonus}</p>
                  </li>
                ))}
            </ul>
          </div>
        );
      }}
    />
  );
};

export default OffersAndLink;
